package operators;

public class RelationalOperators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int num1 = 30;
		int num2 = 15;
		int num3 = 5;
		
		System.out.println("num1 > num2 : " +(num1 > num2));
		System.out.println("num1 < num2 : " +(num1 < num2));
		System.out.println("num1 >= num2 : " +(num1 >= num2));
		System.out.println("num1 <= num2 : " +(num1 <= num2));
		System.out.println("num1 == num2 : " +(num1 == num3));
		System.out.println("num1 != num2 : " +(num1 != num3));
		
	}

}
